from collections import defaultdict

def get_prefixes_and_suffixes(n, strings):
    prefixes = defaultdict(set)
    suffixes = defaultdict(set)

    for s in strings:
        if len(s) == n - 1:
            prefixes[len(s)].add(s)
            suffixes[len(s)].add(s)
        elif len(s) < n - 1:
            prefixes[len(s)].add(s)
        else:
            suffixes[len(s)].add(s)

    return prefixes, suffixes


def solve():
    n = int(input())
    strings = []
    for _ in range(2 * n - 2):
        strings.append(input())

    prefixes, suffixes = get_prefixes_and_suffixes(n, strings)

    result = ['P' if i in prefixes[s] else 'S' for i in strings]
    print(''.join(result))


if __name__ == "__main__":
    solve()
